  return (
    <div className='bg-light'>
      <Tabs defaultActiveKey="home" id="uncontrolled-tab-example" className="mb-3">
        <Tab eventKey="home" title="course">
        <UploadDatas/>
        </Tab>
        <Tab eventKey="contact" title="subcourse">
          <Subcourses/>
        </Tab>
      </Tabs>
    </div>
  );
}

